import React from 'react';
import { Link } from 'react-router-dom';

const Card = ({ name, weight, image, id, temperaments}) => {
  return (
    <div>
      <Link key= {id} to={`/dogs/${id}`}>
      <h3>{name}</h3>
      <p>Temperaments: {temperament?.join(", ")}</p>
      <p>Weight: {weight}</p>  
      <img src={image} alt={name} width='200px' height= '200px'/>
      </Link>
    </div>
  );
};

export default Card;
